import React from 'react';
import './Pin.css';
import pass from './password.png';

const Pin = () => {
  return (
    <div className="outer">
        <div className="inner">
            <div> <img src={pass} /> </div>
            <div className="nam">PIN</div>
            <input type="text" className="pinclass" placeholder="Enter the pin" />
            <button className="but">Verify</button>
        </div>
    </div>
  );
};

export default Pin;
